import { connect } from 'react-redux';

class Wishes extends Component {
  render() {
      const { wishTitle } = this.props;
      console.log(wishTitle)
    return (
      <div>
        {
            wishTitle && wishTitle.map(title => {
                return(<div>
                    <h1>{title.name}</h1>
                </div>)
            })
        }
      </div>
    )
  }
}

const mapStateToProps =(state, ownProps) => {
    // const id = ownProps.params.match.id;
    console.log(ownProps)
    // console.log(id)
    return {
        wishTitle: state.boards
    }
}


export default connect(mapStateToProps)(Wishes)
